import React from 'react'
import { Container, Row, Col } from 'react-bootstrap';
import styles from "./index.module.scss";



interface Props { }
export default (props: Props) => {
    return (
        <Container fluid >
            <Row>
                {/* product Image slider and thumbnails */}
                <Col sm >
                    <Row className={styles.ImageSliderContainer + " "}>
                        <Col sm={3} className={styles.thumbnailsContainer + " -bg-f0f-"} >
                            <div className="-bg-ff0- d-flex -jus-c--sm-dn- flex-md-column m-auto">
                                {["", "", "", "", ""].map(() => {
                                    return (
                                        <div className="my-md-2 -mx-10-" style={{ height: 50, width: 50, backgroundColor: "blue" }}></div>
                                    )
                                })}
                                <div
                                    style={{
                                        height: 30,
                                        width: 50,
                                        backgroundColor: "red",
                                        display: "flex",
                                        position: "absolute",
                                        alignSelf: "center",
                                        left: 0
                                    }}></div>

                                <div
                                    style={{
                                        height: 30,
                                        width: 50,
                                        backgroundColor: "red",
                                        display: "flex",
                                        position: "absolute",
                                        alignSelf: "center",
                                        right: 0
                                    }}></div>
                            </div>
                        </Col>
                        <Col sm={9}>image slider</Col>
                    </Row>
                </Col>
                {/* Product infod accordion */}
                <Col sm style={{ backgroundColor: "green" }}>
                    Image Slider
                </Col>
            </Row>
        </Container>
    )
}
